import React, { useState } from 'react';
import { useTranslation } from 'react-i18next';

import { useNavigate } from 'react-router-dom';

const BookingPage = () => {

    const { t } = useTranslation();

    const navigate = useNavigate();

    const booking = {
        id: 3,
        date: '12.05.2024',
        status: 'booked',
        store: {
            id: 3,
            name: 'Store3'
        },
        bike: {
            id: 1,
            name: 'Lastenrad 1',
            image: require('../../../assets/images/bike1.jpg')
        },
        user: {
            id: 3,
            name: 'alma42'
        },
        equipment: ["Gürtel", "Helm", "Kind"],
        comment: "suspicious activities"
    }


    return (
        <>
            <h1>{t('booking')} {booking.id}</h1>

            <p>{booking.date}</p>
            <p>{booking.status}</p>
            <p>{booking.store.name}</p>
            <p>{booking.bike.name}</p>
            <p>{booking.user.name}</p>
            { booking.equipment?.length !== 0 ?
                <p>{t('equipment')}: {booking.equipment?.map(e => e).join(', ')}</p>
                :
                <p>{t('equipment')}: {t('none')}</p>
            }
            <p>{booking.comment}</p>

            <div className='button-container'>
                <button type='button' className='button accent' onClick={null}>{t('register')}</button>
            </div>
        </>
    );
};

export default BookingPage;
